function Post(props) {


  return (
    <div>
      <div >
        <h2>{props.post.name}</h2>
        <p id="date">{props.post.date}</p>
        <div className="content">         
          <p id="content">{props.post.content}</p>
          <img src={props.post.image} alt={"log"} />
        </div>
      </div>
    </div>
  );  
}

export default Post;
